import React, { Component } from 'react';
import screenshot from './trivia1.png';
import sounddump from './sounddumpreal.png';
class Projects extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className='projects'>
        <div className='projectCard'>
          <div className='imagewrap'>
            <a
              href='https://taylorpenberthy.github.io/projectOneFinal/'
              target='_blank'
            >
              <img src={screenshot} className='projectImages' />
            </a>
          </div>
          <div className='overlay'>
            <p className='text'>
              Taylor's Trivia is the first fullstack web application that I
              developed. I used HTML, CSS, and JavaScript to create a dynamic
              Trivia game all about myself.{' '}
            </p>
          </div>
        </div>
        <div className='projectCard'>
          <div className='imagewrap'>
            <a
              href='https://taylorpenberthy.github.io/projectOneFinal/'
              target='_blank'
            >
              <img src={sounddump} className='projectImages' />
              <div className='overlay'>
                <p className='text'>
                  Taylor's Trivia is the first fullstack web application that I
                  developed. I used HTML, CSS, and JavaScript to create a
                  dynamic Trivia game all about myself.{' '}
                </p>
              </div>
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default Projects;
